import React from "react";
import styled from "styled-components";

const Nav = styled.div`
  width: 230px;
  height: 100vh;
  background-color: #347ab4;
  text-color: #fff;
`;

const Logo = styled.div`
    color: #fff;
    padding-top: 20px;
    margin-down: 20px;
`

function Navbar() {
  return <Nav>
      <Logo>LOGO</Logo>
  </Nav>;
}

export default Navbar;
